import React from 'react';
import PropTypes from 'prop-types';
import { MdCheck, MdKeyboardArrowLeft } from 'react-icons/md';

import { Container, EditOrder } from './styles';
import HeaderList from '../../components/HeaderList';
import history from '../../services/history';
import IconButton from '../../components/ButtonSave';

export default function EdicaoEncomendas({ match }) {
  const { id } = match.params;
  console.tron.log(id);

  return (
    <Container>
      <EditOrder>
        <HeaderList title="Edição de Encomendas">
          <IconButton
            Icon={MdKeyboardArrowLeft}
            title="VOLTAR"
            type="button"
            background="#999"
            action={history.goBack}
          />
          <IconButton
            Icon={MdCheck}
            title="SALVAR"
            type="button"
            action={() => history.push('/encomendas/')}
          />
        </HeaderList>
      </EditOrder>
    </Container>
  );
}

EdicaoEncomendas.propTypes = {
  match: PropTypes.shape({
    params: PropTypes.shape({
      id: PropTypes.string,
    }).isRequired,
  }).isRequired,
};
